import React,{Component} from 'react';
import CardList from './CardList';
import SearchBox from './SerachBox'
import {robots} from './robots';

const state ={
    'robots':robots,
    'searchfield':''
}

class App extends Component{
    constructor(){
        this.state ={
            'robots':robots,
            'searchfield':''
        }
    }
    render(){
        return(
            <div className='tc'>
                <h1>Robo Factory</h1>
                <SearchBox></SearchBox>
                <CardList robots={robots}/>
            </div>
            
        );
    }
    
}

export default App;
